import React from 'react';
import Button from './components/Button';

function App () {
  const handleClick = () => {
    console.log('Botón clickeado');
  };

  return (
    <div>
      <Button text="Haz clic aquí" onClick={handleClick} />
    </div>
  );
};

export default App;
